import React, { useState, useEffect } from 'react';
import { useParams, useNavigate } from 'react-router-dom';
import {
  Box,
  Heading,
  Text,
  Button,
  Flex,
  Spinner,
  Badge,
  Tabs,
  TabList,
  TabPanels,
  Tab,
  TabPanel,
  useToast,
  Stack,
  Link,
  Alert,
  AlertIcon,
  AlertTitle
} from '@chakra-ui/react';
import { ExternalLinkIcon } from '@chakra-ui/icons';
import { useExpeta } from '../context/ExpetaContext';

// Assuming we have a CodeViewer component
const CodeViewer = ({ files = [], language = 'javascript' }) => {
  return (
    <Box p={4} bg="gray.50" borderRadius="md" fontFamily="monospace">
      <Text>Code viewer placeholder: {files.length} files, language: {language}</Text>
      {files.map((file, index) => (
        <Box key={index} mt={4}>
          <Text fontWeight="bold">{file.name || `File ${index + 1}`}</Text>
          <Box 
            p={2} 
            bg="black" 
            color="white" 
            borderRadius="md" 
            mt={1} 
            overflow="auto"
            maxH="300px"
          >
            <pre>{file.content || '// No content available'}</pre>
          </Box>
        </Box>
      ))}
    </Box>
  );
};

const GenerationDetail = () => {
  const { id } = useParams();
  const navigate = useNavigate();
  const toast = useToast();
  const { generations, loadGenerations, validateCode, loading, error } = useExpeta();

  const [generation, setGeneration] = useState(null);
  const [isValidating, setIsValidating] = useState(false);

  // Fetch the generation data
  useEffect(() => {
    const fetchGeneration = async () => {
      // If we don't have generations loaded yet or need to refresh
      if (!generations || generations.length === 0) {
        await loadGenerations();
      }

      // Find the generation with the matching ID
      const foundGeneration = generations?.find(gen => gen.id === id);
      setGeneration(foundGeneration);
    };

    fetchGeneration();
  }, [id, generations, loadGenerations]);

  const handleValidateCode = async () => {
    if (!generation || !generation.expectation) return;

    setIsValidating(true);
    try {
      await validateCode(id, generation.expectation.id);
      toast({
        title: 'Validation started',
        description: 'Your code is being validated against the expectation.',
        status: 'info',
        duration: 3000,
        isClosable: true
      });
      // Navigate to validations page
      navigate('/validations');
    } catch (err) {
      toast({
        title: 'Validation failed',
        description: err.message || 'Failed to validate code. Please try again.',
        status: 'error',
        duration: 5000,
        isClosable: true
      });
    } finally {
      setIsValidating(false);
    }
  };

  if (loading.generations) {
    return (
      <Flex justify="center" align="center" minH="200px">
        <Spinner size="xl" />
        <Text ml={4}>Loading generation...</Text>
      </Flex>
    );
  }

  if (error.generations) {
    return (
      <Alert status="error" borderRadius="md">
        <AlertIcon />
        <AlertTitle>Error loading generation</AlertTitle>
        <Text>{error.generations}</Text>
      </Alert>
    );
  }

  if (!generation) {
    return (
      <Alert status="warning" borderRadius="md">
        <AlertIcon />
        <AlertTitle>Generation not found</AlertTitle>
        <Text>The generation with ID {id} could not be found.</Text>
      </Alert>
    );
  }

  const files = generation.generated_code?.files || [];
  const language = generation.generated_code?.language || 'unknown';

  return (
    <Box>
      <Flex justify="space-between" align="start" mb={6} wrap="wrap" gap={4}>
        <Box>
          <Heading size="lg">
            {generation.expectation?.name || 'Generated Code'}
          </Heading>
          <Flex mt={2} wrap="wrap" gap={2}>
            <Badge colorScheme={generation.success ? 'green' : 'red'} mr={2}>
              {generation.success ? 'Success' : 'Failed'}
            </Badge>
            <Badge colorScheme="blue">
              {language}
            </Badge>
            <Badge>
              {files.length} files
            </Badge>
          </Flex>
        </Box>
        <Stack direction={{ base: 'column', md: 'row' }} spacing={4}>
          <Button 
            colorScheme="blue" 
            onClick={handleValidateCode}
            isLoading={isValidating}
            loadingText="Validating"
          >
            Validate Code
          </Button>
          <Button 
            variant="outline" 
            onClick={() => navigate('/generations')}
          >
            Back to List
          </Button>
        </Stack>
      </Flex>

      <Box bg="white" p={6} borderRadius="md" shadow="md" mb={6}>
        <Text fontSize="lg" mb={4}>
          {generation.expectation?.description || 'No description available'}
        </Text>

        {generation.expectation && (
          <Flex mb={4}>
            <Link 
              color="blue.500" 
              onClick={() => navigate(`/expectations/${generation.expectation.id}`)}
              display="flex"
              alignItems="center"
            >
              View Expectation <ExternalLinkIcon mx={1} />
            </Link>
          </Flex>
        )}

        <Tabs variant="enclosed" colorScheme="blue" mt={6}>
          <TabList>
            <Tab>Generated Code</Tab>
            <Tab>Metadata</Tab>
          </TabList>

          <TabPanels>
            <TabPanel p={0} pt={4}>
              <CodeViewer files={files} language={language} />
            </TabPanel>
            <TabPanel>
              <Stack spacing={4}>
                <Box>
                  <Text fontWeight="bold">Generation ID</Text>
                  <Text>{generation.id}</Text>
                </Box>
                <Box>
                  <Text fontWeight="bold">Created At</Text>
                  <Text>{new Date(generation.created_at || Date.now()).toLocaleString()}</Text>
                </Box>
                <Box>
                  <Text fontWeight="bold">Status</Text>
                  <Badge colorScheme={generation.success ? 'green' : 'red'}>
                    {generation.success ? 'Success' : 'Failed'}
                  </Badge>
                </Box>
                {generation.error && (
                  <Box>
                    <Text fontWeight="bold">Error</Text>
                    <Text color="red.500">{generation.error}</Text>
                  </Box>
                )}
              </Stack>
            </TabPanel>
          </TabPanels>
        </Tabs>
      </Box>
    </Box>
  );
};

export default GenerationDetail;
